import styled, { keyframes } from 'styled-components';
import React, { useState, useEffect } from 'react';
import Bull from '../../BullOnCliff.PNG';
import Phone from '../../AppPhone.PNG';

// Keyframes for fade-in and fade-out effects
const fadeIn = keyframes`
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
`;

const fadeOut = keyframes`
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
`;

// Keyframes for shooting star effect
const shootingStar = keyframes`
  0% {
    opacity: 0;
    transform: translateX(-50px) translateY(-50px) rotate(45deg);
  }
  50% {
    opacity: 1;
    transform: translateX(150px) translateY(150px) rotate(45deg);
  }
  100% {
    opacity: 0;
    transform: translateX(300px) translateY(300px) rotate(45deg);
  }
`;

// Styled-components for both pages
const PageWrapper = styled.div`
  width: 100%;
  height: 100vh;
  background: ${(props) => (props.isWhite ? 'white' : 'black')};
  display: flex;
  justify-content: center;
  align-items: center;
  animation: ${(props) => (props.fadeOut ? fadeOut : fadeIn)} 2s forwards;
`;

const HomeWrapper1 = styled.div`
  background: hsla(214, 44%, 17%, 1);
  background: linear-gradient(0deg, hsla(214, 44%, 17%, 1) 0%, hsla(216, 39%, 16%, 1) 0%, hsla(214, 40%, 22%, 1) 100%);
  background-size: cover;
  width: 100%;
  height: 200vh;
  position: absolute;
  top: 0;
  animation: ${fadeIn} 2s ease-in-out;

  @media (max-width: 768px) {
    height: 250vh;
  }
`;

const Bullimg = styled.img`
  width: 42%;
  height: auto;
  position: absolute;
  right: 62%;
  top: 16%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 63.5%;
    top: 16%;
  }

  @media (max-width: 768px) {
    width: 60%;
    right: 45.5%;
    top: 10%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 35%;
  }
`;

const Phoneimg = styled.img`
  width: 40%;
  height: auto;
  position: absolute;
  right: 5%;
  top: 45%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 10%;
    top: 50%;
  }

  @media (max-width: 768px) {
    width: 50%;
    right: -5%;
    top: 40%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 55%;
  }
`;

const ShootingStar = styled.div`
  width: 2px;
  height: 2px;
  background: white;
  box-shadow: 0 0 8px white, 0 0 10px white, 0 0 15px white, 0 0 25px white;
  position: absolute;
  top: 10%;
  left: 10%;
  animation: ${shootingStar} 2s infinite ease-in-out;
  transform-origin: left top;
`;

// Other styled-components for texts...

// Component to manage page transitions
export const Home = () => {
  const [showFirstPage, setShowFirstPage] = useState(true);
  const [fadeOutFirstPage, setFadeOutFirstPage] = useState(false);

  useEffect(() => {
    // Trigger fade-out after a certain time (e.g., 5 seconds)
    setTimeout(() => {
      setFadeOutFirstPage(true);
      setTimeout(() => {
        setShowFirstPage(false); // Switch to the Home page after fade-out
      }, 2000); // Match this duration to the fadeOut animation
    }, 5000); // Adjust the delay to your needs
  }, []);

  return (
    <div>
      {showFirstPage ? (
        <PageWrapper fadeOut={fadeOutFirstPage}>
          {/* First Page Content */}
          <div style={{ color: 'white', fontSize: '2rem' }}>First Page Content Here</div>
        </PageWrapper>
      ) : (
        <HomeWrapper1>
          <ShootingStar />
          <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '200px', color: '#D4F1F4', fontFamily: 'Ubuntu', fontSize: '5vw', fontWeight: 'bold' }}>
            <div> Get the best, Earn the most </div>
          </div>
          <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', color: 'white', fontFamily: 'Ubuntu', fontSize: '2vw', marginTop: '-115px' }}>
            <div> Utilizing AI to generate </div>
            <div> top-tier stocks daily </div>
          </div>
          <div onClick={() => console.log('Navigate to SOTD')} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', fontFamily: 'Ubuntu', fontSize: '1.5vw', color: 'white', marginTop: '250px', cursor: 'pointer', borderRadius: '50px', border: '2px solid white', padding: '4px', width: '20%', height: '4.3%' }}>
            <a href="/sotd" style={{ color: 'black' }}>Today's watchlist</a>
          </div>
          <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'left', marginTop: '240px', color: 'white', fontFamily: 'Ubuntu', fontSize: '6vw', fontWeight: 'bold', top: '70px' }}>
            <div> We are </div>
            <div>Coming soonâ€¦ </div>
          </div>
          <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'left', color: '#D4F1F4', fontFamily: 'Ubuntu', fontSize: '2vw', marginTop: '-220px', position: 'relative', top: '80px' }}>
            <div> SOTD app </div>
          </div>
          <Bullimg src={Bull} />
          <Phoneimg src={Phone} />
        </HomeWrapper1>
      )}
    </div>
  );
};
